import React from "react";
import { Bar } from "react-chartjs-2";

export default function Array() {
    const array: number[] = [9, 7, 2, 1, 4, 8, 0, 3, 6, 5];
    const chartData = {
        labels: array,
        datasets: [{ 
        label: "values",
        data: array, 
        backgroundColor: "#377E86" 
    }],
    };

    return (
        <div>
            <Bar data={chartData} options={{ display: true, title: "Sorting Algorithm" }} />
        </div>
    );
}
